import MainLayout from "../component/MyLayout"
import useSwr from 'swr'

function fetcher(url) {
    return fetch(url).then((r) => {
        return r.json();
    })
}

function Quotes () {
    return (
        <MainLayout>
        <h1>Quotes of the Day</h1>
        </MainLayout>
    )
}

export default Quotes;
